import { Link } from 'react-router-dom';
import { useSelector } from 'react-redux/es/hooks/useSelector';


const NavBar = () => {
  const isLogin = useSelector((state) => state.login.isAuthenthicated);
    return (
      <div className="flex flex-1 ">
        <ul className="flex flex-col mt-4 font-medium lg:flex-row lg:space-x-8 lg:mt-0">
          <li className="block py-2 pr-4 pl-3 text-white rounded bg-primary-700 lg:bg-transparent lg:text-primary-700 lg:p-0 dark:text-white">
            <Link to="/home">Home</Link>
          </li>
          <li className="block py-2 pr-4 pl-3 text-white rounded bg-primary-700 lg:bg-transparent lg:text-primary-700 lg:p-0 dark:text-white">
            <Link to="/your-meetup">Your Meetup</Link>
          </li>
          <li className="block py-2 pr-4 pl-3 text-white rounded bg-primary-700 lg:bg-transparent lg:text-primary-700 lg:p-0 dark:text-white">
            <Link to="/add-meetup">Meetups</Link>
          </li>
        </ul>
      </div>
    );
}
export default NavBar;
